import '../static/styles/UserJob.css'
//import profileImage from '../static/images/aswin.jpg'
import asyncImportComp from '../hoc/asyncImportComp'

function UserJob({ jobname, image, endpoint_url }) {

    // Asyncrounously load Login & Register components instead of importing it always. -> performance increase 
    const profileImage = asyncImportComp(() => {
        return import('../static/images/aswin.jpg')
    })
    return (
        <div className="card">
            <img className="card-img-top" src={profileImage} alt=""></img>
            <div className="card-body">
                <h5 className="card-title">{jobname}</h5>
                <div className="card-text">

                </div>
            </div>
        </div>
    )
}

export default UserJob
